import React from "react";

function note(props) {
  return ( < body > < div className = "" >
    <
    h1 className = "name top" > {
      props.name
    } < /h1> <
    img className = "circle-img"
    src = {
      props.image
    }
    alt = "celebrity-img" / >
    <
    div className = "card info" >
    <
    p className = "" > {
      props.tel
    } < /p > <
    p className = "" > {
      props.email
    } < /p > < /
    div >
    <
    /
    div >
    <
    /body > );
  }

  export default note;
